- input: "TEXT\x1CC00265850\x1C.TEXT\x1C\x1CF3A\x1CAfter a recent internal audit of
    Pryce for Congress, it was discovered that an inaccurate 2008 Year End report
    was inadvertently submitted to the FEC through our electronic filing software.
    \ The committee had every intention of filing the report that was filed as an
    amendment on August 26, 2009, but due to human error the wrong report was originally
    submitted through our electronic system.  Subsequently, this report has an inaccurate
    cash-on-hand amount and is being amended as well.  As soon as the error was discovered
    we took immediate action to submit an accurate accounting of the committee's transactions
    to the FEC.    \n"
